import { FETCH_TODOS_1 } from "../action_types";

const initialState = [];

const fetchTodos_1 = () => {
   const todos_1 = fetch("https://jsonplaceholder.typicode.com/todos")
      .then((response) => response.json())
      .then((jsonData) => JSON.stringify(jsonData));
   return todos_1;
};
console.log(fetchTodos_1());
const todos_1_reducer = (state = initialState, action) => {
   switch (action.type) {
      case FETCH_TODOS_1:
         break;

      default:
         return state;
   }
};

export default todos_1_reducer;
